import React from "react";

const Video = ({ video, onVote, onRemove }) => {
  const handleVoteUp = () => {
    onVote(video.id, 1);
  };

  const handleVoteDown = () => {
    onVote(video.id, -1);
  };

  const handleRemoveVideo = () => {
    onRemove(video.id);
  };

  return (
    <div>
      <h3>{video.title}</h3>
      <iframe
        src={video.url}
        width="560"
        height="315"
        frameBorder="0"
        allowFullScreen
      ></iframe>
      <p>Votes: {video.rating}</p>
      <button onClick={handleRemoveVideo}>Remove</button>
      <button onClick={handleVoteUp}>Up Vote</button>
      <button onClick={handleVoteDown}>Down Vote</button>
    </div>
  );
};

export default Video;
